import React from 'react'
import Practice from './Practice'

const All = () => {
    const image1 = "./photos/web-designing.jpg";
    const image2 = "./photos/web-designing.jpg";
    const image3 = "./photos/web-designing.jpg";
    const image4 = "./photos/web-designing.jpg";
    return (
        <>
         <Practice image={image1} />
         <Practice image={image2} />
         <Practice image={image3} />
         <Practice image={image4} />
        </>
    )
}

export default All
